import './Card.css';
import React, { useState } from 'react';
import { Modal, Backdrop, Fade } from '@mui/material';
import Button from '../../mui_components/Button.js';

// const style = {
//   position: 'absolute',
//   top: '50%',
//   left: '50%',
//   transform: 'translate(-50%, -50%)',
//   width: 400,
//   bgcolor: 'white',
//   border: '2px solid #000',
//   boxShadow: 24,
//   p: 4,
// };

function Card(props) {
  const [open, setOpen] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const stopPropagation = (e) => {
    e.stopPropagation();
  };

  return (
    <div className='Card' onClick={handleOpen}>
      {/* Your existing card content */}
      <div className='Card-img-wrapper'>
        <img className='Card-img' src={props.image} alt={props.alt} />
      </div>
      <div className='Card-content'>
        <h3>{props.title}</h3>
        <h4>{props.subtitle}</h4>
        <p className='Card-description'>{props.description}</p>
      </div>

      {/* Modal */}
      <Modal
        open={open}
        onClose={handleClose}
        // aria-labelledby='modal-title'
        // aria-describedby='modal-description'
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          onClick: handleClose,
          sx: { zIndex: (theme) => theme.zIndex.modal + 1 },
          timeout: 500,
        }}
      >
        <Fade in={open}>
          <div className='Card-modal' onClick={stopPropagation}>
            {/* Add your HTML content related to the card here */}
            <h3 className='Card-modal-title'>{props.title}</h3>
            {/* Add other information related to the card */}
            <p className='Card-modal-description'>{/* Your content here */}</p>
            <Button onClick={handleClose}>Close</Button>
          </div>
        </Fade>
      </Modal>
    </div>
  );
}

export default Card;
